+        // Ensure that we can successfully reseed the RNG a few times
+        int RESEED_COUNT = 3;
+        for(long i = 0; i < (RESEED_COUNT * MAX_REQUESTS_BEFORE_RESEED) + 1; i++) {
+            rng.nextBytes(rngOutputBuffer);
+        }
+    }
