+                    checkArr[x] = (byte) (checkArr[x] | arr[x]);
+                }
+            }
+            for (int x = 0; x < size; x++) {
+                assertTrue(0 != checkArr[x],
+                        "Check array size " + size + " position " + x + " is equal to zero");
+            }
+        }
+    }
+
